import Cell from './Cell'

export default () => {

    const makecells = []
    for(let i=0;i<100;i++) {
        const x = i % 10
        const y = Math.floor(i / 10)
        const position = `${x},${y}`

        makecells.push(<Cell id={position}></Cell>)
    }

    return (
        <>
            {/* <input type='text' onChange={ event => handleChange(event) }></input> */}
            <div className='grid' >
            </div>
        </>
    )

}


